function Navbutton({route}) {

    [isActive,setActive] = useState(false);

    const handleClickCallback = function () {
        console.log("tasks clicked");
        handleClick();
    }

    let className = "navButton " + route;
    if(isActive) {
        className += " active";
    }
    return (
        <div className={className} onClick={handleClickCallback}>{route.toUpperCase()}</div>
    )
}


function Navbar(props) {

    return (
        <div className="topnav">
            <Navbutton route={`tasks`}/>
            <Navbutton route={`team`}/>
        </div>
    );
}

function Navigation(props) {
    return (
        <header className="header">
            <Navbar />
            <div id="projectName">
                <h1>McDonalds Website Project</h1>
            </div>
        </header>
    );
}

export default Navigation;
